■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>ミストとアロマで生活に潤いを。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5368/1031504-01.jpg" width="600" height="655"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------&nbsp;ココがポイント！&nbsp;------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●超音波式の加湿方式なので、熱い蒸気がでません。</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●アロマオイル(別売)使用可能。専用のアロマトレイがあり、使いやすくなっています♪</font></strong></td></tr><tr><td><strong><font size="3" color="#FF9900">●インテリアに馴染む木目調のデザインです☆</font></strong></td></tr></table></td></tr></table><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="317" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5368/1031504-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">しずく型の美しいフォルムの超音波式アロマ加湿器です。木目調のデザインでどんなお部屋にも馴染みます。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常納期より3～6日ほど日数が掛かる場合がございます。■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">しずく型の美しいフォルムの超音波式アロマ加湿器です。木目調のデザインでどんなお部屋にも馴染みます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">約W190×D190×H285mm</font><br><font color="#333333" size="-1">個装サイズ：21×25×20cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約830g</font><br><font color="#333333" size="-1">個装重量：1050g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS樹脂</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">電源:AC100V・50/60Hz<br>加湿方式:超音波式<br>消費電力:26W<br>タンク容量:2.4L<br>加湿能力(最大):約300ml/h<br>連続使用時間:約7～8時間<br>コード長:約1200mm</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書<br>保証書(保証期間:6ヶ月)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常より3～6日ほど日数が掛かる場合がございます。・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
