■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/0000000/0218520-01.jpg" width="600" height="900"><br><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/0000000/0218520-02.jpg" width="600" height="900"><br><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/0000000/0218520-03.jpg" width="600" height="900"><br><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/0000000/0218520-04.jpg" width="600" height="1013"><br></td></tr></table><br><table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><h1><font color="#333333" size="3">加湿器や空気清浄機を使っているとなんだか臭いが…。そんな方に「加湿器・空気清浄機の洗浄剤」！臭いや雑菌の原因はタンクから排水口までに溜まった汚れかも。汚れにかけたり漬けるだけで簡単に落とせます。加湿器/空気清浄機/雑菌/簡単/超音波/臭い/衛生/対策/菌/噴霧器/洗浄/ディフューザー/水タンク/トレー/タバコ/アロマ/ペット</font></h1></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">加湿器や空気清浄機を使っているとなんだか臭いが…。そんな方に「加湿器・空気清浄機の洗浄剤」！臭いや雑菌の原因はタンクから排水口までに溜まった汚れかも。汚れにかけたり漬けるだけで簡単に落とせます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1"> 内容量 </font></td><td width="75%" align="left"><font color="#333333" size="-1">200ml</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">純石けん分（脂肪酸カリウム）、クエン酸、スルファミン酸</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">液性：酸性</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font><